import React from 'react';
import styled from 'styled-components';

const Header = () => (
    <StyleHeader>
        <img src="reddit-brands.svg" alt="logo" />
    </StyleHeader>
);

export default Header;

const StyleHeader = styled.header`
    background-color: #000;
    height: 300px;
    display: flex;
    align-items: center;
`;
